  render() {
    return this.props.todos.map((todo) =>
      ( <
        TodoItem key = {
          todo.id
        }
        markComplete = {
          this.props.markComplete
        }
        todo = {
          todo
        }
        / >
      ));
  }
}

//PropTypes
Todo.PropTypes = {
  todos: PropTypes.array.isRequired,
}


export default Todo;
